(20, 'ယူကရိန်းကို ရုရှားကျူးကျော်မှု -နေတိုးနယ်နိမိတ်ကို အမေရိကန်က ကာကွယ်မယ်၊ ယူကရိန်းကိုတော့ တပ်တွေမလွှတ်ဘူးပြော', 'အမေရိကန် သမ္မတ ဂျိုးဘိုင်ဒန်က အမေရိကန် တပ်ဖွဲ့တွေ ယူကရိန်းစစ်မြေပြင်ကို စေလွှတ်မှာ မဟုတ်ကြောင်း ထပ်လောင်းပြောကြားခဲ့ပါတယ်။\r\n\r\nသူတို့ တပ်ဖွဲ့တွေကို ယူကရိန်းမှာ တိုက်ဖို့ အတွက်တော့ ဥရောပတိုက်ဆီ စေလွှတ်မှာ မဟုတ်ဘူး၊ ဒါပေမယ့် နေတိုး မဟာမိတ်တွေနဲ့ အရှေ့ဥရောပဆီက မဟာမိတ်တွေကို ကာကွယ်ပေးမှာ ဖြစ်တယ်လို့ ပြောပါတယ်။ အမေရိကန် ပြည်ထောင်စု အနေနဲ့ နေတိုးနယ်နိမိတ်ကို တလက်မက အစ အထိမခံဘူး၊ အမေရိကန်ရဲ့ စွမ်းအားကို အပြည့်အဝ အသုံးချပြီး ကာကွယ်ပြမယ်လို့ ပြောပါတယ်။\r\n\r\nဆက်လက်ပြီး နေတိုး အဖွဲ့ဟာ အရင်ကထက် ပိုပြီး ညီညွတ်သွားပြီ၊ အမေရိကန်နဲ့ နေတိုး အဖွဲ့ဝင်တွေဟာ စာချုပ်ပါ ကတိကဝတ်တွေအတိုင်း လိုက်နာကျင့်သုံးကြမယ်ဆိုတာ သံသယ ဖြစ်စရာ မရှိဘူးလို့ ဆိုပါတယ်။\r\n\r\nနေတိုး အဖွဲ့ဝင် နိုင်ငံတွေထဲက ရုရှားရဲ့ ခြိမ်းခြောက် ခံနေရတယ်ဆိုတဲ့ အရှေ့ဥရောပကအဖွဲ့ဝင် နိုင်ငံတွေမှာ အမေရိကန်ကြည်းတပ်နဲ့ တခြား တပ်ဖွဲ့ဝင် ထောင်ပေါင်းများစွာကို ဖြန့်ကြက် ချထားပါတယ်။ အဲဒီ နိုင်ငံတွေထဲမှာ ဘောလ်တစ် နိုင်ငံတွေ ဖြစ်ကြတဲ့ လဗ်ဗီးယား၊ အက်စတိုးနီးယားနဲ့ လစ်သူရေးနီးယားတို့ အပြင် ပိုလန်နဲ့ ရိုမေးနီးယားတို့ ပါဝင်ပါတယ်။', 3, 9, '0', NULL, '2022-02-25 02:15:27'),
(21, 'ပူတင်က သွေးသွင်းဖို့ပါ သွေးပိုတွေ ပို့ထားတာ၊ သူ့ရည်ရွယ်ချက်ကို သိတယ်လို့ ဘိုင်ဒန်ပြော', 'အမေရိကန် သမ္မတ ပူတင်က ရုရှာ သမ္မတ ပူတင်ဟာ ယူကရိန်း နယ်စပ်ကို တပ်ဖွဲ့ဝင်အင်အား ၁၇၅,၀၀၀ နဲ့ စစ်လက်နက် ပစ္စည်းတွေ ပို့ပေးထားသလို သွေးလိုရင် သွင်းနိုင်ဖို့ သွေးပိုတွေပို့ စစ်မြေပြင် ဆေးရုံတွေပါ တည် ပေးထားတာ ဖြစ်ကြောင်း ပြောပါတယ်။\r\n\r\nဆက်လက်ပြီး ပူတင်ဟာ စစ်ကြောင့် ကြုံရမယ့် အနိဋ္ဌာရုံတွေကို ရှောင်ရှားနိုင်ဖို့ အတွက် အနောက်အုပ်စုက ဆွေးနွေးဖို့ ကမ်းလှမ်းသမျှ ငြင်းပယ်ခဲ့တယ်လို့လည်း ဆိုပါတယ်။', 3, 9, '0', NULL, '2022-02-25 03:06:08'),
(22, 'ဆောင်းရာသီ အိုလံပစ် - တရုတ်ရဲ့ ကိုဗစ်မူဝါဒ အလုပ်ဖြစ်သလား', 'တရုတ်ဟာ ဗိုင်းရပ်စ်ကို တားဆီးနိုင်ရေးအတွက် တော်တော်လုပ် ထားပါတယ်။ ပြည်ပပရိတ်သတ်တွေ လာခွင့်မပြုသလို ပြည်တွင်း လူထုကိုလည်း ပြိုင်ပွဲ လက်မှတ်တွေကို ထုတ်မရောင်းပါဘူး။ ဒေသတွင်းက ပရိသတ်တွေကို အဖွဲ့လိုက် ဖိတ်ကြားပြီး ကြည့်ရှု အားပေးခွင့် ပြုမှာ ဖြစ်ပြီး အဲဒီ အခါမှာလည်း ပြိုင်ပွဲတွေကို မလာရောက်ခင်၊ အားပေးနေစဥ်နဲ့ ပြန်လည် ထွက်ခွာကြတဲ့ အချိန်အထိ တင်းကျပ်တဲ့ ကိုဗစ် စည်းမျဥ်းတွေကို လိုက်နာကြရမှာ ဖြစ်ပါတယ်။', 4, 10, '0', NULL, '2022-02-25 03:07:03'),
(23, 'တရုတ်ပြည်တွင်း တခြား ဒေသတွေမှာ နေထိုင်ကြတဲ့ ပြည်သူတွေကိုလည်း ပြိုင်ပွဲ ကျင်းပရာ ဘေကျင်းမြို့ဆီကို မလာကြဖို့ အသိပေးထားပါတယ်။', 'နောက်ပြီး မီဒီယာ၊ အားကစား သမားတွေနဲ့ လေ့လာစောင့်ကြည့်သူတွေကိုလည်း bubble လို့ခေါ်တဲ့ သီးသန့်စီ ခွဲခြားနေထိုင်ရတဲ့ ဇုန်တွေအတွင်းမှာပဲ နေထိုင်စေမှာ ဖြစ်ပါတယ်။ ပြီးတော့ အဲဒီ bubble တွေထဲ ဝင်ထွက်သွားလာကြမယ့် သူတွေဟာလည်း ကာကွယ်ဆေး အပြည့်အဝ ထိုးနှံပြီးသူ ဒါမှမဟုတ် ကွာရန်တင်း ၂၁ ရက်လုပ်ပြီးသူ ဖြစ်ရမယ်လို့ သတ်မှတ်\r\nနောက်ပြီး မီဒီယာ၊ အားကစား သမားတွေနဲ့ လေ့လာစောင့်ကြည့်သူတွေကိုလည်း bubble လို့ခေါ်တဲ့ သီးသန့်စီ ခွဲခြားနေထိုင်ရတဲ့ ဇုန်တွေအတွင်းမှာပဲ နေထိုင်စေမှာ ဖြစ်ပါတယ်။ ပြီးတော့ အဲဒီ bubble တွေထဲ ဝင်ထွက်သွားလာကြမယ့် သူတွေဟာလည်း ကာကွယ်ဆေး အပြည့်အဝ ထိုးနှံပြီးသူ ဒါမှမဟုတ် ကွာရန်တင်း ၂၁ ရက်လုပ်ပြီးသူ ဖြစ်ရမယ်လို့ သတ်မှတ်', 4, 7, '0', NULL, '2022-02-25 03:07:34'),
(24, 'ဒီလူတွေဟာ သူတို့ မိသားစုတွေ အပါအဝင် ပြင်ပလောကနဲ့ လုံးဝ ထိတွေ့ခွင့် ရကြမှာ မဟုတ်ပါဘူး။', 'ဒီစည်းမျဥ်းတွေကို နေထိုင်မှု အပိုင်းမှာသာ ချမှတ်ထားတာ မဟုတ်ပါဘူး။ အိုလံပစ် ပြိုင်ပွဲ ကာလအတွင်း အသုံးပြုမယ့် ဆေးရုံတွေနဲ့ တခြားနေရာတွေ အပြင် သယ်ယူပို့ဆောင်ရေး စနစ်တွေမှာက အစ လိုက်နာကြရမှာ ဖြစ်ပါတယ်။ ပြိုင်ပွဲ ကျင်းပမယ့် နေရာ အတော်များများက ဘေကျင်းမြို့တော်ရဲ့ ပြင်ပမှာ ဖြစ်တဲ့အတွက် ပြိုင်ပွဲအတွက် အသုံးပြုမယ့် လေဆိပ်တွေနဲ့ မြန်နှုန်းမြင့် ရထားလိုင်းတွေကိုလည်း စီစဥ်ပေးထားပါတယ်။\r\n\r\nအိုလံပစ် ပြိုင်ပွဲအတွက် အသုံးပြုမယ့် ယာဥ်တွေကိုလည်း ယာဥ်ရှေ့ပိုင်းမှာ အနီရောင် အမှတ်အသားတွေ တပ်ဆင်ထားမှာ ဖြစ်ပါတယ်၊ အဲဒီ ယာဥ်တွေနဲ့ မတော်တဆ တိုက်မိခိုက်မိ ဖြစ်ရင်တောင် ယာဥ်ပေါ် ပါသူတွေနဲ့ ထိတွေ့ဆက်ဆံမှုမျိုး မလုပ်ကြဖို့ လမ်းစည်းကမ်း ထိန်းသိမ်းရေး ဆိုင်ရာက အများပြည်သူကို အကြံပေးထားပါတယ်။ ကူးစက်မှုတွေ ရှောင်ရှားနိုင်ဖို့ ပြိုင်ပွဲ ကာလအတွင်း ထွက်လာတဲ့ အမှိုက်တွေကိုလည်း သီးသန့် နေရာမှာသိမ်းဆည်း ထားမှာ ဖြစ်ပါတယ်။', 4, 19, '0', NULL, '2022-02-25 03:08:11'),
(25, 'ဘယ်ကိုဗစ် စည်းမျဥ်းတွေ စတင်ကျင့်သုံးနေပြီလဲ', 'ပြည်ပနိုင်ငံသားတွေကို တရုတ်ပြည်ထဲ ဝင်ထွက်သွားလာခွင့်ကို တော်တော်လေး တင်းကျပ်ထားပြီး ဖြစ်ပါတယ်။ နောက် ပြည်တွင်း ခရီးသွားလာမှုတွေကိုလည်း လွန်ခဲ့တဲ့ ၂ နှစ် ကပ်ရောဂါတွေ စတင်ဖြစ်ပွားခဲ့တဲ့ အချိန်ကတည်းက စပြီး တင်းကျပ်ထားပါတယ်။\r\n\r\nတရုတ်ပြည်ထဲကို ဝင်ရောက်ဖို့ ခွင့်ပြုချက်ရရှိပြီး ပြည်ပက ရောက်လာတဲ့ ဘယ်သူမဆိုဟာလည်း ရောက်တာနဲ့ ဆေးစစ်ခံရမှာ ဖြစ်ပြီး အစိုးရက သတ်မှတ်ထားတဲ့ ကွာရန်တင်း ဟိုတယ်တွေမှာ အနည်းဆုံး ၂ ပတ် ကွာရန်တင်း ဝင် သီးခြားနေထိုင်ရမှာဖြစ်ပါတယ်။\r\nပြည်ပနိုင်ငံသားတွေကို တရုတ်ပြည်ထဲ ဝင်ထွက်သွားလာခွင့်ကို တော်တော်လေး တင်းကျပ်ထားပြီး ဖြစ်ပါတယ်။ နောက် ပြည်တွင်း ခရီးသွားလာမှုတွေကိုလည်း လွန်ခဲ့တဲ့ ၂ နှစ် ကပ်ရောဂါတွေ စတင်ဖြစ်ပွားခဲ့တဲ့ အချိန်ကတည်းက စပြီး တင်းကျပ်ထားပါတယ်။\r\n\r\nတရုတ်ပြည်ထဲကို ဝင်ရောက်ဖို့ ခွင့်ပြုချက်ရရှိပြီး ပြည်ပက ရောက်လာတဲ့ ဘယ်သူမဆိုဟာလည်း ရောက်တာနဲ့ ဆေးစစ်ခံရမှာ ဖြစ်ပြီး အစိုးရက သတ်မှတ်ထားတဲ့ ကွာရန်တင်း ဟိုတယ်တွေမှာ အနည်းဆုံး ၂ ပတ် ကွာရန်တင်း ဝင် သီးခြားနေထိုင်ရမှာဖြစ်ပါတယ်။', 4, 8, '0', NULL, '2022-02-25 03:08:39'),
(26, 'ကိုဗစ် သုည ဘယ်လောက် အောင်မြင်မှုလဲ', 'အပေါ်ယံကြည့်ရင်တော့ တရုတ်ဟာ ကပ်ရောဂါကို ထိန်းချုပ်မှုတွေဟာ အသိအမှတ် ပြုရလောက်တဲ့ အထိ အောင်မြင်ခဲ့တယ်လို့ ဆိုနိုင်ပါတယ်။ ပြီးခဲ့တဲ့ ၂၀၁၉ နှစ်ကုန်ပိုင်းက စပြီး တရုတ်ပြည်မှာ ကိုဗစ်ကြောင့် သေဆုံးသူ ဦးရေဟာ ၄,၆၀၀ ကျော်ပဲ ရှိတယ်လို့ Our World in Data က ဖော်ပြထားပါတယ်။ အမေရိကန်ပြည်ထောင်စု မှာဆိုရင် ၈၃၀,၀၀၀ ကျော် နဲ့ ယူကေမှာဆိုရင် ၁၅၀,၀၀၀ ကျော်သေဆုံးခဲ့ရပါတယ်။\r\n\r\nလူ တသန်းတိုင်းမှာ ကိုဗစ်ကြောင့် သေဆုံးသူ ဦးရေအရ တရုတ်မှာ ၃ ယောက် ရှိပြီး အမေရိကန်မှာ ၂,၅၀၀ နဲ့ ယူကေမှာ ၂,၁၉၀ ရှိပါတယ်။\r\n\r\nတရုတ်ပြည်မှာ ရောဂါ ကူးစက်ခံရသူ အရေအတွက်ကလည်း တော်တော်ကြီးကို နည်းတာတွေ့ရပါတယ်။ ကပ်ရောဂါ ကာလအတွင်း တနိုင်ငံလုံးမှာ နေ့စဥ် ကူးစက်ခံရသူ ဦးရေဟာ ၁၅၀ ထက်ကျော်တာ ခပ်ရှားရှားပဲ ဖြစ်ပါတယ်။\r\n\r\nဒီလို တရားဝင် ထုတ်ပြန်ချက်တွေဟာ ဘယ်လောက် တိကျသလဲ ဆိုတဲ့ အပေါ်မှာလည်း စိုးရိမ်မှုတွေ ရှိကြပါတယ်။ တခြားနိုင်ငံတွေထက် စာရင် သူတို့ရဲ့ ကူးစက်ခံရမှု နှုန်းနဲ့ သေဆုံးမှုနှုန်းတွေက သိသိသာသာကြီးကို နည်းနေပါတယ်။ တရုတ် အမျိုးသား ကျန်းမာရေး ကော်မရှင်ကတော့ နိုင်ငံ့ လူဦးရေရဲ့ ၈၅ ရာခိုင်နှုန်းကို ကာကွယ်ဆေး အပြည့် ထိုးပေးပြီး ဖြစ်တယ်လို့ ပြောပါတယ်။', 2, 19, '0', NULL, '2022-02-25 03:09:16'),
(27, 'ယူကရိန်းနဲ့ပတ်သက်တဲ့ ပိတ်ဆို့အရေးယူမှုတွေကို ရုရှားက ဘယ်လိုတုံ့ပြန်မလဲ', 'အခု ယူကရိန်းက ခွဲထွက်ဒေသတွေကို ရုရှားက အသိအမှတ်ပြုလိုက်ပြီးတဲ့နောက် နောက်ထပ်တိုးလာတဲ့ အရေးယူပိတ်ဆို့မှုတွေအတွက် သူ ဘာတွေ ပြင်ဆင်ထားပါလဲ။\r\n\r\nရုရှားက ဒီလိုအခြေအနေမှာဆိုရင် ဘယ်လိုရင်ဆိုင်မလဲဆိုတာကို နှစ်ပေါင်းများစွာ ပြင်ဆင် ထားတာပါ။\r\n\r\n၂၀၁၄ ခုနှစ် ရုရှားတပ်တွေ ခရိုင်းမီးယားကို ဝင်ပြီး ယူကရိန်းနိုင်ငံ အစိတ်အပိုင်းကို စကျူးကျော်တဲ့အခါ နိုင်ငံတကာ ပိတ်ဆို့အရေးယူမှု ပထမအကျော့ကို ဖြစ်လာခဲ့ပါတယ်။ အဲဒီကနေ ရုရှားက သင်ခန်းစာကြီးကြီးကို သင်ယူခဲ့ပါတယ်။\r\n\r\nအဲဒီကတည်းက ကာကွယ်ရေးကို သူတည်ဆောက်ခဲ့တယ်၊ ဒေါ်လာအပေါ် မှီခိုနေရတဲ့ အခြေအနေကနေ ကင်းဝေးအောင်လုပ်ခဲ့တယ်၊ ရုရှားစီးပွားရေးကို ပိတ်ဆို့အရေးယူတာ ခံနိုင်အောင် ကြိုးစားခဲ့ပါတယ်။', 2, 7, '0', NULL, '2022-02-25 03:09:51'),
(28, 'နိုင်ငံတကာ အရန်ငွေကြေ', 'ဒီအရန်ငွေကြေးနဲ့ ရုရှားသုံးငွေကြေး ရူဘဲလ်ကို တန်ဖိုးမကျသွားအောင် အချိန်ကာလ အတော် အကြာကြာ ထိန်းနိုင်ပါတယ်။\r\n\r\nလွန်ခဲ့တဲ့ ၅ နှစ်က ရုရှားရဲ့ နိုင်ငံခြားငွေကြေး စုစုပေါင်းရဲ့ ၄၀ % က ဒေါ်လာဖြစ်ပေမဲ့ အခု ၁၆% သာ ဒေါ်လာပါ။ နိုင်ငံခြားငွေကြေး ၁၃% က အခုဆိုရင် တရုတ်ငွေကြေး ရန်မင်ဘီ ဖြစ်နေပါပြီ။\r\n\r\nဒါတွေအားလုံးဟာ အမေရိကန်က ဦးဆောင်လုပ်မယ့် ပိတ်ဆို့အရေးယူတာတွေကို ရုရှားအနေနဲ့ တတ်နိုင်သမျှ ကာကွယ်နိုင်အောင် လုပ်ဆောင်ထားတာပါ။', 2, 19, '0', NULL, '2022-02-25 03:10:12'),
(29, 'ရုရှား ခံတပ်', 'ဒီဗျူဟာမှာ ကြီးမားတဲ့ အစိတ်အပိုင်းအနေနဲ့ ဖြစ်လာတာကတော့ တရုတ်နိုင်ငံပါ။\r\n\r\nအနောက်နိုင်ငံ ဗဟိုဘဏ်တွေက ကြီးကြပ်ထားတဲ့ Swift လို့ ကမ္ဘာလုံးဆိုင်ရာ ဘဏ္ဍာရေး ဝန်ဆောင်မှုကနေ ဖယ်ထုတ်ခံရမယ်ဆိုရင် နိုင်ငံတကာ ငွေပေးငွေယူတာတွေ လုပ်နိုင်တဲ့ ကိုယ်ပိုင်စနစ်ကိုတောင် ရုရှားအစိုးရက အစပျိုး စမ်းသပ်သုံးစွဲနေပါပြီ။\r\n\r\nသူ့အသုံးစရိတ် ဘတ်ဂျက်ကိုလည်း ဖြတ်ချထားပြီး စီးပွားရေးတိုးတက်မှုအစား စီးပွားရေး တည်ငြိမ်မှုကိုပဲ ဦးစားပေးထားပါတယ်။\r\n\r\nအကျိုးဆက်အနေနဲ့ ပြီးခဲ့တဲ့ ၁၀ စုနှစ်အတွင်း ရုရှားစီးပွားရေးက နှစ်စဉ် ပုံမှန်အားဖြင့် ၁% ပဲ တိုးတက်စေတာပါ။ ပြုပြင်ပြောင်းလဲနေတဲ့လုပ်ငန်းစဉ်အတွင်းမှာ အပြင်ကယူမယ့်အစား ကိုယ့် အရင်းအမြစ်တွေကို ပိုပြီး အားကိုးရေးကို ပိုလုပ်လာပါတယ်။', 2, 10, '0', NULL, '2022-02-25 03:10:32');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_published`, `ordering`, `created_at`) VALUES
(30, 'ဗျူဟာမြောက် အကျိုးစီးပွားများ', '&lt;p&gt;                                        အရေးယူပိတ်ဆို့တာတွေကို အခုလို တုံ့ပြန်မှာက မော်စကိုအတွက် အန္တရာယ်များတဲ့ ကစားပွဲ တခုပါ။ ရုရှားရဲ့ အဓိကဘဏ်တွေ၊ အထူးသဖြင့် နိုင်ငံပိုင် ဘဏ်တွေ ပိတ်ဆို့အရေးယူတာ ခံရရင် အဲဒါတွေက ထိခိုက်မှု ပြင်းပါတယ်။\r\n\r\nဒါပေမဲ့ အမေရိကန်၊ ဗြိတိန်၊ ဥရောပ သမဂ္ဂတို့အနေနဲ့ မတူညီတဲ့ ဗျူဟာမြောက် အကျိုး စီးပွားတွေကို စဉ်းစားကြလိမ့်မယ်လို့ သမ္မတ ပူတင်က တွက်ချက်ပါတယ်။\r\n\r\nရုရှားရဲ့ ရေနံနဲ့ ဓာတ်ငွေ့လုပ်ငန်းကို အရေးယူပိတ်ဆို့တယ်ဆိုပါစို့၊ တနိုင်ငံနဲ့ တနိုင်ငံ အနေအထားက မတူပါဘူး၊ တချို့ကလွယ်ပေမယ့် တချို့အတွက် မလွယ်ပါဘူး။ ဥပမာ၊ ဥရောပသမဂ္ဂကိုကြည့်ရင် သူ့အတွက် သဘာဝဓာတ်ငွေ့ ၄၀ % က ရုရှားက လာတာပါ။ ဗြိတိန်က ၃ % ပဲ ရှိပါတယ်။\r\n\r\nဂျာမနီက နော့ဒ် ၂ ဓာတ်ငွေ့ပိုက်လိုင်းကို ရပ်ထားလိုက်ပြီလို့ ဆုံးဖြတ်တဲ့အတွက် ရုရှားကို ထိခိုက်ပါတယ်၊ ဒါပေမယ့် အနောက်ဥရောပနိုင်ငံတွေမှာ စွမ်းအင်စျေးတွေတက်မယ့် တိုက်ရိုက် သက်ရောက်မှုလည်း ရှိလာပါတယ်။&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 656.312px;&quot; data-filename=&quot;tree-ga11dc77e3_1920.jpg&quot;&gt;                                    &lt;/p&gt;', 2, 8, '0', NULL, '2022-02-25 03:10:51');
